import React from "react";
import { Card, Input, Dropdown, Radio, Button, Form } from "antd";
const items = [
  {
    key: "1",
    label: <a>India</a>,
  },
  {
    key: "2",
    label: <a>UK</a>,
  },
  {
    key: "3",
    label: <a>US</a>,
  },
];
const UserDetail = () => {
  return (
    <div>
      <Card
        borderd={true}
        style={{
          width: 600,
          height: 900,
          borderColor: "gray",
          justifyContent: "center",
          alignContent: "center",
          display: "flex",
          marginLeft: 700,
        }}
      >
        <Form>
          <Form.Item label="FirstName" style={{size:large}}>
            <Input />
          </Form.Item>
          <Form.Item label="LastName" style={{size:large}}>
            <Input />
          </Form.Item>
          <Form.Item label="Email" style={{size:large}}>
            <Input />
          </Form.Item>
          <Form.Item label="City" style={{width:large}}>
            <Input />
          </Form.Item>
          <Form.Item label="Country" style={{width:large}}>
            <Dropdown
              menu={{ items, selectable: true }}
              placement="bottomLeft"
              style={{ lineHeight: 3, marginBottom: 20 }}
              arrow={{ pointAtCenter: true }}
            >
              <Button>Choose</Button>
            </Dropdown>
          </Form.Item>
          <Form.Item label="IsActive">
            <Radio />
          </Form.Item>
        </Form>
      </Card>
    </div>
  );
};

export default UserDetail;
